import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import CourseList from "./components/CourseList";

export class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      response: [],
    };
  }

  componentDidMount() {
    fetch(
      "https://api.nytimes.com/svc/search/v2/articlesearch.json?q=election&api-key=YW7v4jYO5anNGpDXSmDXZhswezl4w6yZ"
    )
      .then((res) => res.json())
      .then((data) => {
        this.setState({ isLoaded: true, response: data.response.docs });
        console.log(data.response.docs);
      });
  }

  render() {
    return (
      <div>
        <CourseList
          abstract={this.state.response.docs}
          web_url={this.state.response.docs}
        />
      </div>
    );
  }
}

export default App;
